INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Et vel similique sit animi.', 'Dolorem laboriosam sapiente laborum sapiente ut in. Excepturi et tempora iste voluptates non. Fuga autem officiis vel minima. Est voluptatem accusamus assumenda aut nihil.', 'Deleniti nesciunt iste et consequuntur. Sequi et maxime est deserunt et.', '1995-07-11');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Inventore adipisci eum voluptas saepe reprehenderit praesentium.', 'Nam quaerat nisi aperiam debitis. Corrupti facere nihil reiciendis id. Iure nobis qui eum qui iste. Ex maxime voluptatem officiis officiis ducimus voluptates incidunt.', 'Et ipsum quis suscipit occaecati. Eligendi eos officiis id quia adipisci suscipit consequuntur. Deleniti numquam hic fugit officia.', '1980-01-23');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Aut magni totam illo doloribus eaque eos.', 'Rem qui ipsam id recusandae cumque. Corporis sed laborum aperiam labore non aut suscipit. Aut eligendi doloribus delectus. Fugit consequatur dolor debitis omnis est est.', 'Est occaecati nobis mollitia. Sit beatae ratione enim non. Nesciunt laborum distinctio quisquam itaque ullam. Fugit soluta a itaque fugit.', '2005-06-07');
